// This stores for each level what is the sink and what information required for sink configurationmap<int, String> levelToSinkTypeConfiguration;
// Extra configuration(optional)
map<SinkType, String> sinktypeToSinkConfiguration;

/**
Why COR?
Using COR, We can handle each type of message log separately instead of handling them in one class as each type of log level can have separate destination they can be logged to and also the way that they will logged. It is better to have a separate handler for each type of log level.
We can also add extra handlers in between if in future we want to log the message for some other levels in some other custom log destination as well.
**/
nextLogHandler: LogHandler;
logSink: LogSink
+ LogHandler(nextHandler: LogHandler, logSink: LogSink) {
this. nextLogHandler = nextHandler;
this.logSink = logSink;
}
+ handleLog(LogEntry logEntry): void {
if(nextLogHandler != null) {
nextLogHandler.handleLog()
}
}
